class Solution(object):
	def findLongestWord(self, s, d):
		"""
		:type s: str
		:type d: List[str]
		:rtype: str
		"""
		d = sorted(d, key=lambda x: (-len(x), x))
		def helper(word):

			# 大神做法:
			it = iter(s)
			return all(c in it for c in word)
			# 我的做法
			# i = 0
			# for c in word:
			# 	while i < len(s) and c != s[i]:
			# 		i += 1
			# 	i += 1
			# 	if i >= len(s):
			# 		return False
			# return True

		for word in d:

			if helper(word):
				return word
		return ""


